  //contato
  document
    .getElementById("form_contato")
    .addEventListener("submit", function (event) {
      event.preventDefault(); // Evita o envio padrão do formulário

      let formData = new FormData(this);

      // Limpar mensagens anteriores
      document.getElementById("message-error").classList.add("hidden");
      document.getElementById("message-success").classList.add("hidden");

      fetch("/enviar_formulario.php", {
        method: "POST",
        body: formData,
      })
        .then((response) => response.json())
        .then((data) => {
          if (data.success) {
            // Ocultar o formulário e mostrar mensagem de sucesso
            document.getElementById("form_contato").classList.add("hidden");
            document.getElementById("message-success").textContent =
              "Mensagem enviada com sucesso!";
            document
              .getElementById("message-success")
              .classList.remove("hidden");
          } else {
            // Mostrar mensagem de erro
            document.getElementById("message-error").textContent =
              data.message || "Ocorreu um erro ao enviar a mensagem.";
            document.getElementById("message-error").classList.remove("hidden");
          }
        })
        .catch((error) => {
          console.error("Erro:", error);
          document.getElementById("message-error").textContent =
            "Ocorreu um erro inesperado.";
          document.getElementById("message-error").classList.remove("hidden");
        });
    });

